import { Col, Navbar, Row } from "react-bootstrap";


function Carrinho() {
    return (
        <>
            <Navbar>
                <Row className="justify-content-md-center">
                    <Col md={6}>
                        <h1>Lista de Produtos carrinho </h1>
                    </Col>
                </Row>
            </Navbar>
        </>
    )
}

export { Carrinho }
